import { motion } from "framer-motion";
import data from "../data/data";
let albumCovers = require.context("../../src/assets/albumCovers", true);

function SectionTen({ advanceState }) {
  return (
    <div className="flex h-screen">
      <div className="text-5xl w-1/2 p-12 leading-none">
        <motion.div
          initial={{ y: "-10%", opacity: 0 }}
          animate={{ y: "0%", opacity: 1 }}
          transition={{
            ease: "easeIn",
            duration: 0.8,
            delay: 1,
          }}
        >
          <span className="font-serif">Genre</span> is a category of music,
          literature or other forms of art <br></br> based on some set of
          criteria.
        </motion.div>
        <motion.div
          initial={{ y: "-10%", opacity: 0 }}
          animate={{ y: "0%", opacity: 1 }}
          transition={{
            ease: "easeIn",
            duration: 0.8,
            delay: 3.5,
          }}
          className="select-none absolute bottom-0 left-0 m-12 text-8xl w-min hover:text-gray-200"
          onClick={advanceState}
        >
          â˜ž
        </motion.div>
      </div>
      <motion.div
        initial={{ y: "-10%", opacity: 0 }}
        animate={{ y: "0%", opacity: 1 }}
        transition={{
          ease: "easeIn",
          duration: 1,
          delay: 0,
        }}
        className="w-1/2 bg-gray-100 p-12 overflow-scroll"
      >
        <div className="w-5/6 ">
          {data.map((e) => {
            const del = 1.5 + e.Cover * 0.02;

            return (
              <motion.div
                initial={{ y: "-10%", opacity: 0 }}
                animate={{ y: "0%", opacity: 1 }}
                transition={{
                  ease: "easeIn",
                  duration: 0.8,
                  delay: del,
                }}
                className="w-24 h-24 bg-gray-300 0"
                onClick={advanceState}
                style={{
                  backgroundImage: `url(${
                    albumCovers(`./${e.Cover}.png`).default
                  })`,
                  backgroundSize: "100%",
                }}
              ></motion.div>
            );
          })}
        </div>
      </motion.div>
    </div>
  );
}

export default SectionTen;
